var timer = 100;
function fill(i, j,pre_i,pre_j) {
    setTimeout(function () {
        let x = pre_i + 10;
        let y = pre_j + 10;
        document.getElementById(x + "" + y).classList.remove("cur");
        if (pre_i !== 10 || pre_j !== 10)
            document.getElementById(x + "" + y).classList.add("abc");
        x = i+10; y = j + 10;
        document.getElementById(x+"" +y).classList.add("cur");
    },timer);
}
function dfs(sx,sy,ex,ey){

    Board[sx][sy] = true;
    timer += 30;

    if(sx === ex && sy === ey){
        return true;
    }

    console.log(sx + " " + sy);

    for(let k=0;k<8;k++){
        let nx = sx + dx[k];
        let ny = sy + dy[k];

        if(nx <= 20 && nx >= 0 && ny <= 50 && ny >= 0){
            if(Board[nx][ny] === false){
                fill(nx,ny,sx,sy);
                let t = dfs(nx, ny, ex, ey);
                if (t === true) {
                    return true;
                }
            }
        }
    }
    return false;

}
